import "./Header.css";

const Header = () => {
  return (
    <header className="header--black">
      <div className="header--logo">
        <a href="/">
          <img
            src="https://upload.wikimedia.org/wikipedia/commons/thumb/f/ff/Netflix-new-icon.png/768px-Netflix-new-icon.png"
            alt="sem conecção"
          ></img>
        </a>
      </div>
      <div className="header--user">
          <a href="/">
          <img
            src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fcommons.wikimedia.org%2Fwiki%2FFile%3ANetflix-avatar.png&psig=AOvVaw2TLXFCJUbQlqjkslBxckfR&ust=1654193338202000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCIjOn8TsjPgCFQAAAAAdAAAAABAD"
            alt="sem conecção"
          ></img>
          </a>
      </div>
    </header>
  );
};

export default Header;
